import { Button, Space, Form, Typography } from 'antd';
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import moment from 'moment';
const { Text, Link } = Typography;
const Exam = () => {
	const userId = localStorage.getItem('userId');
	const { id } = useParams();
	const [now, setNow] = useState(moment());
	const [remainTime, setRemaintime] = useState(0);
	const endDate = moment('2019-02-09 17 17:16', 'YYYY-MM-DD HH:mm');
	useEffect(() => {
		let myInterval = setInterval(() => {}, 1000);
		return () => {
			clearInterval(myInterval);
		};
	});
	const substract = () => {
		const date = moment();
		setRemaintime(date.subtract(endDate.year, 'years'));
	};
	return (
		<Form>
			<Space direction={'vertical'}>
				<Form.Item>
					<Text>Remain Time : {now.format('HH:mm')}</Text>
				</Form.Item>
				<Form.Item>
					<Button>Submit</Button>
				</Form.Item>
				<Form.Item>
					<di>{id}</di>
				</Form.Item>
			</Space>
		</Form>
	);
};
export default Exam;
